svg.onload:
const corrente = document.getElementById('corrente');
const corrente2 = document.getElementById('corrente2');
window.setInterval(() => {
	corrente.style['stroke-dashoffset'] = Number.parseFloat(corrente.style['stroke-dashoffset']) - 0.25;
	corrente2.style['stroke-dashoffset'] = Number.parseFloat(corrente2.style['stroke-dashoffset']) + 0.25;
}, 10);
document.addEventListener('keydown', (ev) => {
	if (ev.key == 'ArrowLeft') {
		console.log('previous!');
		window.location.href = "./nominal.svg";
	}
	if (ev.key == 'ArrowRight') {
		console.log('next!');
		window.location.href = "./falta2.svg";
	}
});
